import React from "react";
import '../App.css';
import Nav from "./Nav";
import Main from "./Main";
import Footer from "./Footer";
import {HashRouter, Route, Switch} from "react-router-dom";
import BooksContainer from "../lists/BooksList";
import EbooksList from "../lists/EbooksList";
import BorrowedList from "../lists/BorrowedList";
import WishlistList from "../lists/WishlistList";

export default function FullProject() {
    return(
        <>
            <HashRouter>
                <Switch>
                    <Route path={"/books"} component={BooksContainer} />
                    <Route path={"/ebooks"} component={EbooksList} />
                    <Route path={"/borrowed"} component={BorrowedList} />
                    <Route path={"/wishlist"} component={WishlistList} />
                </Switch>
            </HashRouter>
        </>
    )
};
